import { Component } from "react";

import Filter from "../components/Filter";
import Sorter from "../components/Sorter";
import ShoppingList from "../components/ShoppingList";

export default class CartPage extends Component {

    constructor(props) {
        super(props);
        this.state = {}
    }

    componentDidMount() { }

    render() {
        return (
            <>
                <div>
                    <Filter />
                </div>
                <div>
                    <Sorter />
                    <ShoppingList />
                </div>
            </>
        )
    }
}
